const getRotateDegree = (viewBox: string) => {
  const viewBoxArray = viewBox.split(' ');

  return `${+viewBoxArray[2] / 2} ${+viewBoxArray[3] / 2}`;
};

const IconTemplate = ({
  className,
  style,
  spin,
  rotate,
  onClick,
  iconName,
}: IconContentProps): React.ReactElement => {
  return (
    <svg
      viewBox={icons[iconName].viewBox}
      focusable="false"
      className={`jth-icon${className ? ` ${className}` : ``}${spin ? ' spin' : ``
        }`}
      style={style}
      width="1em"
      height="1em"
      fill="currentColor"
      aria-hidden="true"
      onClick={onClick}
    >
      <path
        transform={
          rotate
            ? `rotate(${rotate} ${getRotateDegree(icons[iconName].viewBox)})`
            : undefined
        }
        d={icons[iconName].d}
      />
    </svg>
  );
};

